<template>
	<div>
		<mt-header fixed :title="titles">
			<div slot="left">
				<header-back>
					<mt-button icon="back"></mt-button>
				</header-back>
			</div>
		</mt-header>
		<div class="addshop_cont">
			<div class="addshop_list">
				<p><span>*</span>商品名称</p>
				<input type="text" v-model="goodsName" placeholder="请输入商品名称" />
			</div>
			<div class="addshop_list">
				<p><span>*</span>商品价格(元)</p>
				<input type="text" v-model="price" placeholder="请输入单价" />
			</div>
			<div class="addshop_list">
				<p><span>*</span>商品编号</p>
				<input type="text" v-model="goodsNo" placeholder="请输入商品编号" />
			</div>
			<div class="addshop_list">
				<p><span>*</span>商品描述</p>
				<textarea v-model="goodsContent" placeholder="请输入商品描述"></textarea>
			</div>
			<div class="addshop_list">
				<p><span>*</span>商品主图</p>
				<div class="addshop_mall">
					<input v-if="anios==2" class="file" name="file" type="file" accept="image/png,image/gif,image/jpeg" @change="update" ref="idCardAFile" />
					<input v-else class="file" name="file" type="file" accept="image/png,image/gif,image/jpeg" @click="updates('A')" ref="idCardAFile" />
					<img v-if="allpic==''" :src="goodsImg" />
					<img v-else :src="allpic" />
				</div>
			</div>
			<div class="addshop_list addshop_detail">
				<p><span>*</span>商品详情图</p>
				<div class="addshop_mall">
					<input v-if="anios==2" class="file" name="file" type="file" accept="image/png,image/gif,image/jpeg" @change="updated" ref="idCardAFile" />
					<input v-else class="file" name="file" type="file" accept="image/png,image/gif,image/jpeg" @click="updates('B')" ref="idCardAFile" />
					<img v-if="setail==''" :src="goodsMemo" class="acaa" />
					<img v-else :src="setail" class="bacc" />
				</div>
			</div>
		</div>
		<router-link to="" class="buttons" style="z-index: 3;">
			<mt-button type="danger" @click="addedit" class="add_btns" size="large">完成</mt-button>
		</router-link>
	</div>
</template>

<script>
	import axios from 'axios';
	import Qs from 'qs'
	export default {
		name: "addshop",
		data: () => ({
			titles:'添加商品',
			goodsName: "", //商品名称
			goodsContent: "", //商品描述
			price: "", //价格
			goodsImg: "https://resource.jtsc.club/tianjiacaipin.png", //商品图片
			goodsMemo: "https://resource.jtsc.club/tianjiacaipin@2x.png", //商品详情图
			goodsNo: "", //商品编号
			keys: '',
			flag: 1, //1：新建，2：编辑
			token:'',
			allpic:"",  //商品主图
			setail:"",  //商品详情图
			anios:"",
			pdsfz: 1, //判断哪个图
		}),
		methods: {
			downApp() {
				let ua = navigator.userAgent.toLowerCase();
				//Android终端
				let isAndroid = ua.indexOf('Android') > -1 || ua.indexOf('Adr') > -1;
				//Ios终端
				let isiOS = !!ua.match(/\(i[^;]+;( U;)? CPU.+Mac OS X/);
				if(/(iPhone|iPad|iPod|iOS)/i.test(navigator.userAgent)) {
					this.anios = 2;
					//Ios
				} else if(/(Android)/i.test(navigator.userAgent)) {
					this.anios = 1;
					//Android终端
				}
			},
			//查询信息
			eyeinform() {
				let url = "UserInterface/BusinessUnion/UserBusinessProductSelect.ashx";
				let param = {
					goodskey: this.keys
				};
				this.$post(url, param).then((data) => {
					if(data.rspCode != 1) {
						return;
					}
					this.goodsName = data.data.goodsName;
					this.goodsContent = data.data.goodsContent;
					this.price = data.data.price;
					this.goodsNo = data.data.goodsNo;
					this.allpic = data.data.goodsImg;
					this.setail = data.data.goodsMemo; //data.data.goodsMemo
				})
			},
			//添加编辑
			addedit() {
				if(this.goodsName==''){
					this.$Toast('请填写商品名称');
					return;
				}
				if(this.price==''){
					this.$Toast('请填写商品单价');
					return;
				}
				if(this.goodsNo==''){
					this.$Toast('请填写商品编号');
					return;
				}
				if(this.goodsContent==''){
					this.$Toast('请填写商品描述');
					return;
				}
				if(this.allpic==''){
					this.$Toast('请选择商品主图');
					return;
				}
				if(this.setail==''){
					this.$Toast('请选择商品详情图');
					return;
				}
				let url = "UserInterface/BusinessUnion/UserBusinessProductEdit.ashx";
				let param = {
					goodskey: this.keys,
					goodsName: this.goodsName,
					price: this.price,
					goodsNo: this.goodsNo,
					goodsContent: this.goodsContent,
					goodsImg: this.allpic,
					goodsMemo: this.setail,
					flag: this.flag
				};
				this.$post(url, param).then((data) => {
					this.$Toast(data.rspDesc);
					if(data.rspCode != 1) {
						return;
					}
					this.$router.push('/commodity');
				})
			},
			updates(allst) {
				if(allst=='A'){
					this.pdsfz=1;
				}else{
					this.pdsfz=2;
				}
				let param={
					"AK":"8XKGsaXw9FJJXY8aDNbqI3sH3Y93HLBqIr20UvDM",
	            	"SK":"Y-BMwCi3_aPwD61dCbKRU0DDKOBKcEwyLo0ch-7Z",
	            	"Bucket":"banner"
				};
				axios.post('https://webresource.jtsc.club/GetQNToken.ashx', param).then((data) => {
			        this.upToken=data.data.token;
			        window.back.clickOnAndroidSelectPhoto();
//					let names='';
//					showbg(names)
				})
			},
			showbg(name) {
				let _this=this;
				var pic = name;
				var url = "https://up-z2.qiniup.com/putb64/-1";
				var xhr = new XMLHttpRequest();
				xhr.onreadystatechange=function(){
				  	if (xhr.readyState==4){
				  		if(_this.pdsfz==1){
				  			_this.allpic='https://resource.jtsc.club/'+(JSON.parse(xhr.responseText)).key;
				  		}else{
				  			_this.setail='https://resource.jtsc.club/'+(JSON.parse(xhr.responseText)).key;
				  		}
				   	}
				}
				xhr.open("POST", url, true);
				xhr.setRequestHeader("Content-Type", "application/octet-stream");
				xhr.setRequestHeader("Authorization","UpToken "+this.upToken);
				xhr.send(pic);
			},
			//上传商品主图
			update(e) {
				let file = e.target.files[0];
				let d = new Date();
          		let type = file.name.split('.');
				let param={
					"AK":"8XKGsaXw9FJJXY8aDNbqI3sH3Y93HLBqIr20UvDM",
	            	"SK":"Y-BMwCi3_aPwD61dCbKRU0DDKOBKcEwyLo0ch-7Z",
	            	"Bucket":"banner"
				};
				axios.post('https://webresource.jtsc.club/GetQNToken.ashx', param).then((data) => {
					let params = new FormData(); //创建form对象
			        params.append('chunk','0');//断点传输
			        params.append('chunks','1');
			        params.append('file',file,file.name);
			        params.append('token',data.data.token);
			        params.append('name','orderReview/'+d.getFullYear()+'/'+(d.getMonth()+1)+'/'+d.getDate()+'/'+d.valueOf()+'.'+type[type.length-1]);
			        params.append('key','orderReview/'+d.getFullYear()+'/'+(d.getMonth()+1)+'/'+d.getDate()+'/'+d.valueOf()+'.'+type[type.length-1]);
					this.uploading(params)
				})
			},
			uploading(param) {
				axios.post('https://up-z2.qiniup.com/', param).then((data) => {
					this.allpic='https://resource.jtsc.club/'+data.data.key;
				})
			},
			
			//上传详情图
			updated(e) {
				let file = e.target.files[0];
				let d = new Date();
          		let type = file.name.split('.');
				let param={
					"AK":"8XKGsaXw9FJJXY8aDNbqI3sH3Y93HLBqIr20UvDM",
	            	"SK":"Y-BMwCi3_aPwD61dCbKRU0DDKOBKcEwyLo0ch-7Z",
	            	"Bucket":"banner"
				};
				axios.post('https://webresource.jtsc.club/GetQNToken.ashx', param).then((data) => {
					let params = new FormData(); //创建form对象
			        params.append('chunk','0');//断点传输
			        params.append('chunks','1');
			        params.append('file',file,file.name);
			        params.append('token',data.data.token);
			        params.append('name','orderReviewd/'+d.getFullYear()+'/'+(d.getMonth()+1)+'/'+d.getDate()+'/'+d.valueOf()+'.'+type[type.length-1]);
			        params.append('key','orderReviewd/'+d.getFullYear()+'/'+(d.getMonth()+1)+'/'+d.getDate()+'/'+d.valueOf()+'.'+type[type.length-1]);
					this.uploadingd(params);
				})
			},
			uploadingd(param) {
				axios.post('https://up-z2.qiniup.com/', param).then((data) => {
					this.setail='https://resource.jtsc.club/'+data.data.key;
				})
			}
		},
		mounted() {
			let sKey = this.$route.params.sKey;
			this.keys = sKey;
			if(sKey != 0) {
				this.titles='编辑商品';
				this.keys = sKey;
				this.flag = 2;
				this.eyeinform();
				
			} else {
				this.titles='添加商品';
				this.keys = '';
				this.flag = 1;
			}
			this.downApp();
			window.showbg=this.showbg;
		}
	}
</script>

